(function () {
    'use strict';

    if (/disable-cmp=true/.test(document.cookie) || location.href.indexOf('disable-cmp=true') > -1) {
        return false;
    }

    ensureVisitorId();
    setCmpCookiesIfProvidedAsQueryStrings();

    // TCF stub
